    {

        return(
            <>
           <div><h1>  Information</h1> </div> 


            <div>
                {element.map((ele)=>
            {

            if ( Number(ele.id) ===Number(props.match.params.id))
            {

                return <div align='center'><ul><li>ID:{ele.id}</li><li>USERID:{ele.userId}</li><li>TITLE:{ele.title}</li></ul></div>
            }
        }
            )}
            </div>
            <button align='center'>Add new post</button>
           </>

            )

    }

export default withRouter(Web);
